import React from 'react';
import ReactDOM from 'react-dom';

const ToDoList = () =>{
  return(
    <ul>
      <li>Параметр 1</li>
      <li>Что-то еще</li>
    </ul>
  );
};

const AppHeader = () =>{
  return(
    <h1>Мой список</h1>
  );
};

const SearchPanel = () =>{
  return(
    <input placeholder="поиск" />
  );
};

const App = () =>{
  return(
  <div>

    <AppHeader/>
    <SearchPanel />
    <ToDoList/>
  </div>  
  );
};

ReactDOM.render(<App />, document.getElementById('root'));
